@Dragonetti0311 Unlikely.

The world will move to cheap $50,000 #China mass produced electron beam lithography machines to make Nano Imprint Lithography moulds to imprint 5000 wafers to 1nm node.

In 2030 they will be saying who is #ASML? https://t.co/Bj1PWVapPQ

@RowanHarwood @andrew_lilico Unilateral decarbonisation by the U.K. - or even #CANZUK + EU + USA - will make no difference.

China and the rest will decarbonise when it makes sense for them.

We should focus on adapting, and policies that make sense whether the Earth warms or cools.
